package r2b

import (
	"fmt"
	"testing"
)

func TestGetRemoteConvertBase64(t *testing.T) {
	imgUrl := "https://img-blog.csdnimg.cn/350174dad84e4ecaa0f7995207791df9.jpeg"
	tff := "longshuhongheicuti.ttf"
	imgName := "test.jpg"
	isDelImg := true
	str, err := GetRemoteConvertBase64(imgUrl, tff, imgName, isDelImg, nil, nil)
	if err != nil {
		fmt.Println(err.Error())
	}
	fmt.Println(str)
}

func TestGetRemoteConvertBase64WithPoint(t *testing.T) {
	imgUrl := "https://img-blog.csdnimg.cn/350174dad84e4ecaa0f7995207791df9.jpeg"
	tff := "longshuhongheicuti.ttf"
	imgName := "test.jpg"
	isDelImg := true
	points := make([]*PointInfo, 0)
	points = append(points, &PointInfo{
		X:     220,
		Y:     390,
		With:  140,
		Align: 2,
		Info:  "wangdada",
	})
	fontColor := &RGB{
		R: 12,
		G: 10,
		B: 188,
	}
	str, err := GetRemoteConvertBase64(imgUrl, tff, imgName, isDelImg, points, fontColor)
	if err != nil {
		fmt.Println(err.Error())
	}
	fmt.Println(str)
}

func TestBase64StrHandler2Base64(t *testing.T) {
	base64Str := "data:image/png;base64,"
	tff := "longshuhongheicuti.ttf"
	imgName := "test.jpg"
	isDelImg := true
	str, err := Base64StrHandler2Base64(base64Str, tff, imgName, isDelImg, nil)
	if err != nil {
		fmt.Println(err.Error())
	}
	fmt.Println(str)
}
